import React from 'react'
import babyPic from '../baby.png'
function Graphics() {
    const graphics = {
        backgroundColor: 'blue',
        width: '100wv',
        height: '100hv'
    }
  return (
    <div>
        <img basrc={babyPic} alt="" />    
    </div>
  )
}

export default Graphics
